INSERT INTO `participantes` VALUES ('Adriano Borges','123456','Adriano Machado Borges','AdrianoBorges.jpg',1777,'adriano.mborges@hotmail.com','Descricao Padrao'),('Alessandro Paula','123456','Alessandro Paula','AlessandroPaula.jpg',1590,'alessandro@amsistemas.com.br','Sou Analista de Sistemas ha 16 anos, desde 1998 trabalho com WEB, ja desenvolvi varios sites, sistemas e aplicac'),('alvaro Santos','123456','alvaro Santos','alvaroSantos.png',693,'alvarosantos@mail.com.br','Sou recem formado em Sistemas de Informacao e atuo como desenvolvedor web desde meu primeiro estagio. Comecei a pos para aperfeicoar meus conhecimentos e conhecer mais dessa incrivel area de atuacao. Como hobbies tenho a pratica de corrida,e a leitura de livros de filosofia e mitologia de varios povos.'),('Alysson Barros','123456','Alysson Barros','AlyssonBarros.png',1630,'arb35@yahoo.com.br','Sou Tecnologo de sistemas, e atualmente trabalho na area comercial da Cemig,  sou administrador dos sistemas que envolvem o faturamento, ajudo tambem na manutencao do nosso site corporativo na rede e na intranet (sharepoint).'),('Amaury Costa','123456','Amaury Goncalves Costa','AmauryCosta.jpg',2370,'baugoncalves@gmail.com','sou formado em Sistemas de Informacao pela Faculdade Doctum. Meu inicio de desenvolvimento em web comecou em agosto de 2011, em uma empresa que desenvolvia sites e sistemas em JavaScript, CSS, HTML, PHP e SGBD Mysql. Gosto de assistir filmes, seriados e animes.'),('Andre Zerbinato','123456','Andre Simonelli Zerbinato','AndreZerbinato.jpg',5252,'andresimonelli@gmail.com','Cursando Pos-Graduacao em Desenvolvimento de Aplicac'),('Anselmo Nunes','123456','Anselmo Maciel Nunes','AnselmoNunes.jpg',4500,'anselmomaciel@gmail.com','Graduado em Ciencia da Computacao pela UNISUL-SC em 1999. Analista de Sistemas do Tribunal de Justica de Santa Catarina desde 2003. Alem da paixao pela minha familia, tento incansavelmente aprender a tocar guitarra.'),('Antonio Lima','123456','Antonio Augusto de Lima','AntonioLima.jpg',880,'aaugustodelima@gmail.com','Sou formado em Ciencia e professor de Matematica pela rede estadual. Atualmente estou no ultimo semestre Analise e Desenvolvimento de Sistemas. E para Adquiri conhecimento em WEB resolve fazer esta especializacao. Gosto de estuda e pratico karate.'),('Braulio Barbosa','123456','Braulio Batista Alvarenga Barbosa','BraulioBarbosa.jpg',2371,'brauliobatista@ig.com.br','Formado em Computacao - Sistemas de Informacao, pelo Unileste-MG, nao tenho emprego fixo na area de TI, mas tenho experiencia em manutencao / desenvolvimento de websites e sistemas desktops. Realizacao de manutencao e criacao de recursos para o site de vendas de anuncios www.tocknet.com.br. Desenvolvimento de sistema desktop em Java com JPA para empresa Aquarius Decorarte. Desenvolvimento de sistema web para gerenciamento de processos do setor juridico e estagio do curso de direito do Unileste-MG, e etc. Gosto de futebol, filmes e jogos online (LOL, PES2013...)'),('Bruno Foletto','123456','Bruno Sokolosk Foletto','BrunoFoletto.jpg',4214,'chad_sm@hotmail.com','Ex-militar e Bacharel em Ciencia da Computacao em 2013, tenho gosto pela area da web. Gosto de ver filmes e series, alem de games.'),('Carlos Possa','123456','Carlos Henrique Coimbra Possa','CarlosPossa.jpg',1630,'carlos@mastersig.com.br','Bacharel em Ciencia da Computacao pela UNIPAC de Barbacena. Sou responsavel pelo departamento de desenvolvimento de sistemas onde trabalho, atuando principalmente com C# e Delphi.'),('Cassio Borges','123456','Cassio Henrique Borges','CassioBorges.png',1608,'cassiohenriqueborges@hotmail.com','Formado em Sistemas de Informacao pela faculdade - Centro Universitario do Planalto de Araxa - Pos Graduado pela Uni Minas em Seguranca da Informacao. Trabalho na area de ti ha 12 anos com infra-estrutura de rede e servidores Windows e Linux. Atualmente decidi mudar um foco e embarquei neste novo desafio da minha vida que e desenvolver Aplicativos para Web.'),('Cedric Filho','123456','Cedric Carol Patrician Williams Filho','CedricWilliams.jpg',4400,'cedricstm@yahoo.com.br','Analista de Sistemas, usando Java para Web. Formado pela UFPA em Processamento de Dados em 2000. Atualmente me dedico a tecnologia Java com foco em RIA.'),('Daniel Araujo','123456','Daniel Oliveiros Almeida de Araujo','DanielAraujo.jpg',1879,'DanO.A.Araujo@gmail.com','Formado em Ciencia da Computacao pela Universidade Vale do Rio Doce em 2011. Tenho como hobbies leitura, quebra-cabecas logicos, assistir series e filmes e escrever.'),('Daniel Estrazulas','123456','Daniel Severo Estrazulas','DanielEstrazulas.png',4500,'daniel.estrazulas@gmail.com','Formado em ciencias da computacao pela FURB e atualmente na profissao de Analista de Sistemas no Instituto Federal de Santa Catarina. Meus hobbies sao praticar Karate e andar de bike. Ja trabalhei como avaliador de aplicativos PAF-ECF e desenvolvimento Mobile.'),('Daniela Gondim','123456','Daniela Gondim','DanielaGondim.jpg',1608,'daniela.gondim2012@gmail.com','Sou formada em Sistemas de Informacao pela Universidade de Uberaba e trabalho a 2 anos como Analista de Sistemas no setor de desenvolvimento.'),('David Rodrigues','123456','David Abraao Petro Rodrigues','DavidRodrigues.jpg',4174,'david.abraao.petro@gmail.com','Graduado em Sistemas para Internet. Analista de Sistemas Desenvolvedor empresa propria. Hobbies gosto de brincar com PHP antes de dormir. Gosto de treinar boxes e submission quando tenho tempo. Pretendo com a pos ampliar meu conheco Web.'),('Dayan Lemos','123456','Dayan Lemos','DayanLemos.jpg',2115,'dayan-lemos@hotmail.com','Formado em Analise e Desenvolvimento de Sistemas pela Universidade Federal de Vicosa. Programador Web na empresa Get Enterprise Technology.'),('Douglas Moreira','123456','Douglas Jose Antunes Moreira','DouglasMoreira.jpg',1947,'email@email.com','Bacharel em Ciencia da Computacao, atua no desenvolvimento de aplicac'),('Edesio Souza','123456','Edesio Pereira de Souza','EdesioSouza.png',1730,'edesiopsd@gmail.com','Sou formado em Ciencia da Computacao. Pratico futebol e ciclismo. Como hobbie, gosto de ler, jogar xadrez,  ver filmes/series e desenhar.'),('Edson Figueiredo','123456','Edson Pinheiro de Figueiredo','EdsonFigueiredo.jpg',3658,'edsonfigue@gmail.com','Sou professor de matematica da rede publica desde que me formei. Formado em Licenciatura em Matematica pela UFRJ em 2010. Cursei mestrado profissional em matematica na PUC-Rio de 2012 a 2013, mas nao terminei. Minha experiencia em informatica foi os 2 anos em que atuei como professor de Informatica para concursos publicos em cursos preparatorios. Sei pouco de web, ou melhor, quase nada. Escolhi este curso para justamente preencher esta lacuna. Gosto de ouvir musica, ir a praia, viajar, e cozinhar. Sou casado e tenho um filho de 4 anos, que sempre quer brincar nas horas que tento estudar. Estou com grandes espectativas nesta especializacao.'),('Elizangela Silva','123456','Elizangela Mattos Faria da Silva','ElizangelaSilva.jpg',116,'elizangela@gmail.com','Formada em Analise de Sistemas pela Universidade Federal de MS, trabalho como coordenadora de informatica em uma escola particular (Colegio Alexander Fleming). Sou apaixonada por boa musica, livros e filmes.'),('erik','6a42dd6e7ca9a813693714b0d9aa1ad8','Erik de Oliveira Ramos','test-pass-icon.png',5199,'ramos.erik88@yahoo.com.br','Sou analista de sistemas e trabalho com desenvolvimento web a 2 anos e meio, moro no cidade de sao carlos a 3 anos e sou formado em Ci√É¬™ncia da Computa√É¬ß√É¬£o pela PUC Minas Po√É¬ßos de Caldas'),('Erik Guimaraes','123456','Erik Guimaraes Silva','ErikSilva.jpg',4382,'erikguimaraesdasilva@gmail.com','Formado em Sistemas de Informacao, trabalha com desenvolvimento web, design e UX.'),('Fabiano Carlos','123456','Fabiano Pessoa Carlos','FabianoCarlos.jpg',3658,'fabiano.pessoa5@gmail.com','Tenho 32 anos, Sou bacharel em Administracao pela Estacio de Sa, Pos-Graduado em Engenharia de Software pela ULT , formacao tecnica em Suporte