 desenvolvimento de sistemas, tenho proficiencia em data warehouse, fiz cursos oficiais nas ferramentas Business Objects (OLAP) e Power Center (ETL). Tambem tenho vivencia e formacao oficial no banco de dados Oracle, alem disso, sou certificado no sistema operacional Linux. Venho desenvolvendo aplicativos para WEB desde 2003, ja utilizei as linguagens: PHP, Javascript, .Net, C#, Java, Ajax, Xajax. Ja passei por micro empresas de desenvolvimento ate grandes fabricas de software como IBM. Tenho interesse em engenharia de software, modelos de ciclo de vida de software, arquitetura de sistemas e Linux.'),('Joao Martinez','123456','Joao Paulo da Silva Canadell Martinez','JoaoMartinez.jpg',16,'jp@amperstudio.com.br','Sou mineiro, mas acabei me mudando para o ES ainda muito jovem. Sempre gostei de tecnologia e descobrir como algo funciona. (ate hoje me pego desmontando alguma coisa, e para monta de volta sempre sobram algumas coisinhas kkk). Sou bacharel em sistemas de informacao, fundei junto com um amigo uma empresa de  soluc'),('Joao Silva','123456','Joao Antonio da Silva','JoaoSilva.jpg',1580,'joaoa.comp@gmail','Cientista da Computacao, professor substituo na Universidade Federal de Alfenas, amante de tecnologia e viciado em series de TV, que tenta uma vida saudavel com praticas diarias de atividades fisicas e alimentacao (quase) sempre controlada.'),('Jonathan Schneider','123456','Jonathan Schneider','JonathanSchneider.png',5270,'cabral345@hotmail.com','Graduado em Ciencia da Computacao pelo UNIVEL e pos-graduado em Arquitetura JAVA/SOA pela FIAP. Trabalho atualmente com analise/desenvolvimento JavaEE/EJB, nas horas vagas brinco com front-end e acredito que o JavaScript vai dominar o mundo!!'),('Jose Filho','123456','Jose Augusto Monteiro Viana de Souza Filho','JoseFilho.jpg',2436,'j.augusto30@gmail.com','Graduado em Web design e Programacao pela Universidade do Sul de Santa Catarina com 10 anos de experiencia como Web designer. Professor de Web design e Desktop publishing do Senac Para.'),('Juliana Silva','123456','Juliana Aparecida da Silva','JulianaSilva.jpg',1625,'julianapr.silva@gmail.com','Ola, sou formada Sistemas para Internet pelo IF Sudeste MG '),('Kennedi Malheiros','123456','Kennedi Malheiros','KennediMalheiros.jpg',2065,'kennedimalheiros@gmail.com','Sou graduado pela Faculdade de Ciencias Exatas e Tecnologicas Santo Agostinho em Sistemas de Informacao, trabalhando atualmente com desenvolvimento Java, gosto muito de desenvolvimento Web e Mobile.'),('Klaisler Santos','123456','Klaisler Antunes Santos','KlaislerSantos.jpg',1630,'katekas@gmail.com','Bacharel em Sistemas de Informacao pela PUC Minas - Sao Gabriel (Belo Horizonte - Minas Gerais) concluido no segundo semestre de 2009. Trabalho com desenvolvimento Web desde 2007 quando participei do programa Proform .NET (student to Business) criado pela Microsof com o apoio da PUC Minas.'),('Leonardo Oliveira','123456','Leonardo Ant','LeonardoOliveira.jpg',2089,'leonardo.ns.2008@hotmail.com','Sou formado em Ciencia da Computacao pela Universidade de Itauna/MG. Estou comecando a desenvolver projetos Web e me interesso bastante por essa area. Gosto de musica, esportes e de viajar.'),('Leonardo Soares','123456','Leonardo Cabral Soares','LeonardoSoares.jpeg',1630,'mail@larback.com.br','In google we trust'),('Lucas Masi','123456','Lucas Jotadiemel Masi','LucasMasi.jpg',1630,'ljmasi@gmail.com','Sou formado em Ciencia da Computacao pela Puc Minas e Matematica Computacional pela UFMG. Trabalho ha mais de 5 anos na UFMG com desenvolvimento web utilizando a linguagem Java e os frameworks Hibernate e JSF.'),('Matheus Melo','123456','Matheus Leao de Melo','MatheusMelo.jpg',2370,'matheusleaodemelo@gmail.com','Descricao Padrao'),('Nikolas Teixeira','123456','Nikolas Rodrigues Teixeira','NikolasTeixeira.jpg',1630,'nikolasrod@gmail.com','Formado em Analise e Desenvolvimento de Sistemas, programador Python na empresa Starline Tecnologia. Chrome e o melhor navegador, nao odeio o Windows 8, 